part of 'character_detail_cubit.dart';@immutableabstract class CharacterDetailState {}class CharacterDetailLoadingState extends CharacterDetailState {}class CharacterDetailSuccsesLoadState extends CharacterDetailState {  CharacterDetailSuccsesLoadState(this.character);  final Character character;}class CharacterDetailErrorState extends CharacterDetailState {  CharacterDetailErrorState({this.error});  final Object? error;}